import axios from 'axios';
import * as config from './config';

export const  fetchAllUserAccount = async  () => {

    let userAccounts = [];
    await axios.get(config.userAccountManagementBackendUrl)
        .then(res => {
            userAccounts = res.data.json();
            console.log(userAccounts + "--> 1")
        }).catch((err) => {
            console.log(err)
    });
    console.log(userAccounts + "-->2")
    return userAccounts;
};

export const createNewUserAccount = (newUserAccount) => {
    axios.post(config.userAccountManagementBackendUrl, newUserAccount)
        .then(res => {
            const account = res.data;
            console.log(account);
            return account;
        })
};

export const deleteUserAccountById = (id) => {
    axios.delete(config.userAccountManagementBackendUrl + `\\${id}`)
        .then(res => {
            const account = res.data;
            console.log(account);
            return account;
        })
};

export const updateUserAccount = (newUserAccount) => {
    axios.patch(config.userAccountManagementBackendUrl, newUserAccount)
        .then(res => {
            const account = res.data;
            console.log(account);
            return account;
        })
};
